params.spec:
{
  $schema: https://vega.github.io/schema/vega-lite/v5.json
  data: {
    url: {
      %context%: true
      %timefield%: @timestamp
      index: kibana_sample_data_logs
      body: {
        aggs: {
          countries: {
            terms: {
              field: geo.src
              size: 25
            }
            aggs: {
              hours: {
                histogram: {
                  field: hour_of_day
                  interval: 1
                }
                aggs: {
                  unique: {
                    cardinality: {
                      field: clientip
                    }
                  }
                }
              }
            }
          }
        }
        size: 0
      }
    }
    format: {property: "aggregations.countries.buckets"}
  }

  transform: [
    {
      flatten: ["hours.buckets"],
      as: ["buckets"]
    }
  ]

  mark: {
    type: rect
    tooltip: true
  }

  encoding: {
    x: {
      field: buckets.key
      type: ordinal
      axis: {
        title: false
        labelAngle: 0
      }
    }
    y: {
      field: key
      type: nominal
      sort: {
        field: -buckets.unique.value
      }
      axis: {title: false}
    }
    color: {
      field: buckets.unique.value
      type: quantitative
      axis: {title: false}
      scale: {
        scheme: reds
      }
    }
  }
}
